  {title: "I built a simple blog", body: "This is my first blog post!"},
  {title: "I enjoy coding as a way to feel calm", body: "This is my first blog post!"}
];



function App() {
  return (
   <main>
    <div>

    </div>
    { blogs.map((blog) =>  <Blogcard blog={blog} />) }
   </main>
  );
}

